function Input(props) {
  const { labelName, forInput, typeInput, placeholderInput } = props;
  return (
    <label
      for={forInput}
      className="flex flex-col text-[14px] text-denim font-sans font-normal mb-[24px]"
    >
      {labelName}
      <input
        type={typeInput}
        name={forInput}
        placeholder={placeholderInput}
      />
    </label>
  );
}

export default Input;
